import React, { useState } from "react";

export const Tasks = () => {
  const [tasks, setTask] = useState([
    { id: 1, item: "Doctor's Appt", day: "Feb 6", reminder: true },
    { id: 2, item: "Cat's Appt", day: "Feb 7", reminder: true },
    { id: 3, item: "Dog's Appt", day: "Feb 8", reminder: true },
    { id: 4, item: "Horse's Appt", day: "Feb 9", reminder: true },
  ]);
  return (
    <div>
      {tasks.map((task) => {
        return <h1 key={task.id}>{task.item}</h1>;
      })}
    </div>
  );
};
